import {createGlobalStyle} from 'styled-components';
import Pretendard2 from './Pretendard-Regular.woff2';
import Pretendard2Bold from './Pretendard-Bold.woff2';
import Pretendard2Medium from './Pretendard-Medium.woff2';
import Pretendard2ExtraBold from './Pretendard-ExtraBold.woff2';
import Pretendard2Light from './Pretendard-Light.woff2';
import Pretendard2Thin from './Pretendard-Thin.woff2';

export default createGlobalStyle`
    @font-face {
        font-family: 'Pretendard';
        src:url(${Pretendard2}) format('woff2'),
            url(${Pretendard2Bold}) format('woff2'),
            url(${Pretendard2Medium}) format('woff2'),
            url(${Pretendard2ExtraBold}) format('woff2'),
            url(${Pretendard2Light}) format('woff2'),
            url(${Pretendard2Thin}) format('woff2');
    }
`;
